using Backend.Classes;
using Backend.Context;

namespace Backend.Services;

public class DbInitializer(WebShop24DbContext webShop24DbContext)
{
    // Erstelle Datenbank, falls noch nicht erstellt
    public void Initialize()
    {
        if (webShop24DbContext.Database.EnsureCreated())
        {
            InsertDummyDataToDb();
        }
    }

    public async void InsertDummyDataToDb()
    {
        User newUser = new()
        {
            UserId = 0,
            Username = "admin",
            Password = "1234",
            Cash = 1000
        };
        await webShop24DbContext.Users.AddAsync(newUser);
        // DirectBuyArticles
        for (int i = 0; i < 9; i++)
        {
            DirectBuyArticle directBuyArticle = new()
            {
                ArticleId = 0,
                OwnerId = 1,
                Price = 100,
                ArticleName = "Schuh" + i,
                Pictures = ["data:image/jpeg;base64,"],
                Description = "das ist ein schuh",
                Owner = newUser
            };
            await webShop24DbContext.Articles.AddAsync(directBuyArticle);
            await webShop24DbContext.SaveChangesAsync();
            DirectBuyArticle directBuyArticle2 = new()
            {
                ArticleId = 0,
                OwnerId = 1,
                Price = 100,
                ArticleName = "Schuh" + ++i,
                Pictures = ["data:image/jpeg;base64,"],
                Description = "das ist ein schuh",
                Owner = newUser
            };
            await webShop24DbContext.Articles.AddAsync(directBuyArticle2);
            await webShop24DbContext.SaveChangesAsync();
        }
        // Auctions
        for (int i = 0; i < 5; i++)
        {
            AuctionArticle auctionArticle = new()
            {
                ArticleId = 0,
                OwnerId = 1,
                ArticleName = "Schuh" + i,
                Pictures = ["data:image/jpeg;base64,"],
                Description = "das ist ein schuh der versteigert wird",
                Bid = 100,
                EndDate = DateTime.Now.AddDays(-10),
                WinnerId = 1,
                Owner = newUser
            };
            webShop24DbContext.Auctions.Add(auctionArticle);
            await webShop24DbContext.SaveChangesAsync();
        }

        for (int i = 0; i < 7; i++)
        {
            AuctionArticle auctionArticle = new()
            {
                ArticleId = 0,
                OwnerId = 1,
                ArticleName = "Schuh" + i,
                Pictures = ["data:image/jpeg;base64,"],
                Description = "das ist ein schuh der versteigert wird",
                Bid = 100,
                EndDate = DateTime.Now.AddDays(10),
                WinnerId = 0,
                Owner = newUser
            };
            webShop24DbContext.Auctions.Add(auctionArticle);
            await webShop24DbContext.SaveChangesAsync();
        }
    }
}